.bf-editor {
  position: static; }

.bf-editor p {
  font-size: 0.65rem; }

/* Custom CSS Scrollbar */
::-webkit-scrollbar {
  width: 8px; }

::-webkit-scrollbar-track {
  background-color: transparent; }

::-webkit-scrollbar-thumb {
  -webkit-border-radius: 0px;
  border-radius: 0px;
  background: #DDD; }

::-webkit-scrollbar-thumb:window-inactive {
  background: #f7f7f7; }
