/* 
  FormGroup.scss
  - Includes all default styles for the FormGroup component
*/
.form-group {
  font-size: 13px;
  position: relative;
}
.form-group:not(:last-child) {
  margin-bottom: 0.4rem;
}
.form-group .tooltip .icon {
  margin-right: 5px;
  background-color: #f4f4f4;
  border-radius: 100px;
  width: 16px;
  height: 16px;
  display: flex;
  align-items: center;
  justify-content: center;
}
.form-group .tooltip .tooltip-body {
  position: absolute;
  z-index: 999;
  background-color: #ffffff;
  box-shadow: 0 3px 10px #f4f4f4;
  width: 150px;
  top: 24px;
  right: 4px;
  padding: 8px 12px;
}
.form-group .tooltip .tooltip-body.hidden {
  visibility: hidden;
}
.form-group .tooltip .tooltip-body.visible {
  visibility: visible;
}
.form-group .tooltip .tooltip-body p {
  font-size: 11px;
  line-height: 0.8rem;
  margin: 0;
  color: #212121;
}
.form-label {
  display: flex;
  color: #333333;
  line-height: 1.2rem;
  font-size: 13px;
  font-weight: 400;
  box-sizing: border-box;
  box-shadow: none;
  padding: 0;
  overflow-wrap: break-word;
  margin: 0;
  margin-top: 0.6rem;
  align-items: center;
  justify-content: space-between;
}
.has-success .form-label,
.is-success + .form-label {
  color: #bad80a;
}
.has-error .form-label,
.is-error + .form-label {
  color: #e81123;
}
.form-input-hint {
  list-style: none;
  margin: 0;
  padding: 0;
  color: #989898;
  font-size: 12px;
  margin-top: 0.2rem;
  width: 100%;
}
.has-success .form-input-hint,
.is-success + .form-input-hint {
  color: #bad80a;
}
.has-error .form-input-hint,
.is-error + .form-input-hint {
  color: #e81123;
}
.form-group.horizontal {
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: space-between;
  flex-wrap: wrap;
  margin-bottom: 0.4rem;
  /*   & .form-checkbox, .form-radio, .form-switch {
    padding-right: 0;
    padding-left: 1rem;
  }

  & .form-switch {
    padding-left: 1.8rem;
  } */
}
.form-group.horizontal .form-label {
  width: 50%;
  justify-content: flex-start;
  margin-top: 0;
}
.form-group.horizontal .form-label .tooltip {
  padding-left: 12px;
}
.form-group.horizontal .form-input-container {
  width: 50%;
  display: flex;
  justify-content: flex-end;
}

/* 
  Form.scss 
  - Includes all default styles for the Form component
*/
.form .form-footer-button {
  display: flex;
  align-items: center;
  flex-direction: row-reverse;
  justify-content: space-between;
  padding-top: 24px;
}

/* CSS for Accordion Component (based on Spectre.css) */
.accordion {
  margin-bottom: 16px;
  width: 100%;
}
.accordion .accordion-item {
  margin-bottom: 16px;
}
.accordion .accordion-header {
  display: flex;
  justify-content: space-between;
  align-items: center;
  height: 42px;
  padding: 0 8px;
  background-color: #f7f7f7;
}
.accordion .accordion-header:hover {
  background-color: #f3f3f3;
  cursor: pointer;
}
.accordion .accordion-header h3 {
  font-size: 13px;
  font-weight: 500;
  color: #333333;
  padding-left: 12px;
  margin: 0;
}
.accordion .accordion-header .accordion-action .btn {
  min-width: auto;
  background: none;
  padding: 0 8px;
}
.accordion .accordion-header .accordion-action .btn:focus {
  outline: 0;
  box-shadow: none;
}
.accordion .accordion-header .accordion-action .btn:hover {
  opacity: 0.8;
}
.accordion .accordion-body {
  padding: 8px 8px 0px 8px;
}
.accordion-empty-children h3 {
  padding-left: 1.5rem !important;
}

/* 
  Select.scss 
  - Includes all default styles for the Select component
*/
.form-select {
  appearance: none;
  -webkit-appearance: none !important;
  border: 0.05rem solid #a6a6a6;
  border-radius: 0.1rem;
  color: inherit;
  font-size: 0.6rem;
  height: 1.8rem;
  line-height: 1.2rem;
  outline: none;
  margin-top: 0.4rem;
  padding: 0.25rem 0.4rem;
  vertical-align: middle;
  width: 100%;
  background: #FFF url("data:image/svg+xml;charset=utf8;base64,") no-repeat right 0.35rem center / 0.4rem 0.5rem !important;
}
.form-select:hover {
  border-color: #333333;
}
.form-select:focus {
  border-color: #0078d4;
}
.form-select::-ms-expand {
  display: none;
}
.form-select.select-sm {
  font-size: 11px;
  height: 1.4rem;
  padding: 0.05rem 1.1rem 0.05rem 0.3rem;
}
.form-select.select-lg {
  font-size: 16px;
  height: 2rem;
  padding: 0.35rem 1.4rem 0.35rem 0.6rem;
}
.form-select[size],
.form-select[multiple] {
  height: auto;
  padding: 0.25rem 0.4rem;
}
.form-select[size] option,
.form-select[multiple] option {
  padding: 0.1rem 0.2rem;
}
.has-success .form-select,
.form-select.is-success {
  background: #fdfef2;
  border-color: #bad80a;
}
.has-success .form-select:focus,
.form-select.is-success:focus {
  box-shadow: 0 0 0 0.1rem rgba(186, 216, 10, 0.2);
}
.has-error .form-select,
.form-select.is-error {
  background: white;
  border-color: #e81123;
  color: #e81123;
}
.has-error .form-select:focus,
.form-select.is-error:focus {
  box-shadow: 0 0 0 0.1rem rgba(232, 17, 35, 0.2);
}
.form-select:disabled,
.form-select.disabled {
  background-color: #f7f7f7 !important;
  cursor: not-allowed;
  opacity: 0.5;
}

/* 
  Switch.scss 
  - Includes all default styles for the Switch component
*/
.form-switch {
  font-size: 0.6rem;
  min-width: 48px;
  display: block;
  line-height: 1.3rem;
  margin: 0.2rem 0;
  min-height: 1.2rem;
  padding: 0.1rem 0.4rem 0.1rem 1.2rem;
  position: relative;
}
.form-switch input {
  clip: rect(0, 0, 0, 0);
  height: 1px;
  margin: -1px;
  overflow: hidden;
  position: absolute;
  width: 1px;
}
.form-switch input:focus + .form-icon {
  border-color: #a6a6a6;
}
.form-switch input:checked + .form-icon {
  background: #f4f4f4;
  border-color: #0078d4;
  box-shadow: none;
}
.form-switch .form-icon {
  border: 0.05rem solid #adadad;
  cursor: pointer;
  display: inline-block;
  position: absolute;
  transition: background 0.2s, border 0.2s, box-shadow 0.2s, color 0.2s;
}
.form-switch span {
  padding-left: 29px;
}
.form-switch .form-icon {
  background: #f4f4f4;
  background-clip: padding-box;
  border-radius: 0.45rem;
  height: 19px;
  left: 0;
  width: 2.4rem;
  border-color: #333333;
  top: 0.25rem;
}
.form-switch .form-icon::before {
  background: #333333;
  border-radius: 50%;
  content: "";
  display: block;
  height: 0.6rem;
  left: 3px;
  position: absolute;
  top: 50%;
  transform: translateY(-50%);
  transition: background 0.2s, border 0.2s, box-shadow 0.2s, color 0.2s, left 0.2s;
  width: 0.6rem;
}
.form-switch input:checked + .form-icon {
  background-color: #0078d4;
  border: none;
}
.form-switch input:checked + .form-icon::before {
  background-color: #f4f4f4;
  left: 32px;
}
.form-switch input:active + .form-icon::before {
  background-color: #0078d4;
}
.has-error .form-switch .form-icon,
.form-switch.is-error .form-icon {
  border-color: #e81123;
}
.has-error .form-switch .form-icon::before,
.form-switch.is-error .form-icon::before {
  background-color: #e81123;
}
.has-error .form-switch input:checked + .form-icon,
.form-switch.is-error input:checked + .form-icon {
  background: #e81123;
  border-color: #e81123;
}
.has-error .form-switch input:focus + .form-icon,
.form-switch.is-error input:focus + .form-icon {
  box-shadow: 0 0 0 0.1rem rgba(232, 17, 35, 0.2);
  border-color: #e81123;
}
.form-switch input:disabled + .form-icon,
.form-switch input.disabled + .form-icon {
  opacity: 0.5;
}
.form-switch input:checked:disabled + .form-icon,
.form-switch input:checked.disabled + .form-icon {
  opacity: 0.5;
}
.form-switch.mini .form-icon {
  height: 0.1rem;
  width: 1.3rem;
  top: 0.5rem;
}
.form-switch.mini .form-icon::before {
  height: 0.6rem;
  width: 0.6rem;
  left: -1px;
  background-color: #FFF;
  border: 2px #333 solid;
}
.form-switch.mini input:active + .form-icon::before {
  background-color: #333;
}
.form-switch.mini input:focus + .form-icon {
  border-color: #333;
}
.form-switch.mini input:checked + .form-icon::before {
  left: 14px;
  background-color: #0078d4;
  border: none;
}
.form-switch.mini.has-error .form-switch.mini .form-icon::before,
.form-switch.mini.is-error .form-icon::before {
  border-color: #e81123;
}
.form-switch.mini.has-error .form-switch.mini input:checked + .form-icon::before,
.form-switch.mini.is-error input:checked + .form-icon::before {
  background: #e81123;
}
.form-switch .off {
  left: 21px;
  color: #5c4545;
}
.form-switch .on {
  left: 6px;
  color: #ffffff;
}
.form-switch .text {
  padding-left: 0;
  position: absolute;
  font-size: 11px;
  font-weight: 500;
}

/* 
  Checkbox.scss 
  - Includes all default styles for the Checkbox component
*/
.form-colorpicker {
  position: relative;
  height: 24px;
  width: 24px;
  border: 1px solid #000000;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
}
.form-colorpicker .colorpicker-container {
  position: relative;
}
.form-colorpicker .colorpicker-container .form-input {
  font-size: 0.6rem;
}
.form-colorpicker .colorpicker-modal {
  position: fixed;
  z-index: 99;
  left: 0;
  top: 42px;
  margin-top: 10px;
  right: 0;
  width: 280px;
  height: 350px;
  left: 50%;
  margin-left: -140px;
  top: 50%;
  margin-top: -125px;
  background-color: #fff;
  border: 1px solid rgba(0, 0, 0, 0.2);
  border-radius: 0.25em;
  box-shadow: 0 3px 6px rgba(119, 91, 91, 0.3);
}
.form-colorpicker .colorpicker {
  height: 220px;
  width: 100%;
}
.form-colorpicker .colorpicker .map {
  height: 200px;
}
.form-group.horizontal .form-colorpicker .colorpicker {
  left: -6.5rem;
  right: auto;
}
.form-colorpicker .slider {
  position: absolute;
  user-select: none;
}
.form-colorpicker .slider.vertical {
  top: 0;
  bottom: 0;
  left: 50%;
  width: 10px;
  cursor: ns-resize;
  height: 5.5rem;
}
.form-colorpicker .slider.vertical .track {
  position: absolute;
  top: 0;
  bottom: 0;
  left: 50%;
  width: 8px;
  margin-left: -4px;
}
.form-colorpicker .slider.horizontal {
  left: 0;
  right: 0;
  top: 50%;
  height: 10px;
  cursor: ew-resize;
}
.form-colorpicker .slider.horizontal .track {
  position: absolute;
  left: 0;
  right: 0;
  top: 50%;
  height: 8px;
  margin-top: -4px;
}
.form-colorpicker .slider .track {
  border-radius: 3px;
  background: #888;
}
.form-colorpicker .slider .pointer {
  position: absolute;
  bottom: 50%;
  left: 50%;
  width: 16px;
  height: 16px;
  margin-left: -8px;
  margin-bottom: -8px;
  border-radius: 16px;
  background: #fff;
  box-shadow: inset 0 0 0 1px #ccc, 0 1px 2px #ccc;
  will-change: left, bottom;
}
.form-colorpicker .hue-slider {
  position: absolute;
  top: 1em;
  bottom: 1em;
  right: 1.3em;
}
.form-colorpicker .hue-slider .track {
  background: linear-gradient(to bottom, #FF0000 0%, #FF0099 10%, #CD00FF 20%, #3200FF 30%, #0066FF 40%, #00FFFD 50%, #00FF66 60%, #35FF00 70%, #CDFF00 80%, #FF9900 90%, #FF0000 100%);
}
.form-colorpicker .opacity-slider {
  position: absolute;
  top: 230px;
  left: 1em;
  right: 2em;
}
.form-colorpicker .opacity-slider .slider {
  background: #fff url("data:image/gif;base64,R0lGODdhEAAQAPEAAMvLy8zMzP///wAAACwAAAAAEAAQAEACHYxvosstCAEMrq6Jj812Y59NIDQipdY5XLWqH4sVADs=") repeat;
  background-size: 8px 8px;
  height: 8px;
}
.form-colorpicker .opacity-slider .slider .track {
  height: 8px;
  margin-top: -4px;
  background: linear-gradient(to right, rgba(255, 255, 255, 0) 0%, #FFF 100%);
}
.form-colorpicker .with-opacity-slider {
  height: 235px;
}
.form-colorpicker .with-opacity-slider .map {
  bottom: 2em;
}
.form-colorpicker .with-opacity-slider .hue-slider {
  bottom: 2em;
}
.form-colorpicker .picker {
  position: relative;
  margin-bottom: 1em;
}
.form-colorpicker .picker:after {
  content: "";
  display: table;
  clear: both;
}
.form-colorpicker .picker-right {
  height: 20em;
}
.form-colorpicker .map {
  position: absolute;
  top: 1em;
  bottom: 1em;
  right: 2em;
  left: 1em;
  overflow: hidden;
  user-select: none;
  border-radius: 0.25em;
}
.form-colorpicker .map.active {
  cursor: none;
}
.form-colorpicker .map.dark .pointer {
  border-color: #fff;
}
.form-colorpicker .map.light .pointer {
  border-color: #000;
}
.form-colorpicker .map .pointer {
  position: absolute;
  width: 10px;
  height: 10px;
  margin-left: -5px;
  margin-bottom: -5px;
  border-radius: 100%;
  border: 1px solid #000;
  will-change: left, bottom;
}
.form-colorpicker .map .background {
  top: 0;
  left: 0;
  position: absolute;
  height: 100%;
  width: 100%;
}
.form-colorpicker .map .background:before,
.form-colorpicker .map .background:after {
  display: block;
  content: '';
  position: absolute;
  top: 0;
  left: 0;
  bottom: 0;
  right: 0;
}
.form-colorpicker .map .background:after {
  background: linear-gradient(to bottom, transparent 0%, black 100%);
}
.form-colorpicker .map .background:before {
  background: linear-gradient(to right, white 0%, rgba(255, 255, 255, 0) 100%);
}
.colorpicker-more {
  position: absolute;
  line-height: 28px;
  left: 8px;
}
.form-colorpicker .swatch {
  height: 22px;
  width: 22px;
}
.bf-editor-form-group.horizontal .form-colorpicker .swatch {
  width: 22px;
}
.form-colorpicker .picker-visible {
  visibility: visible;
}
.form-colorpicker .picker-invisible {
  visibility: collapse;
}
.form-colorpicker .colorpicker-input-container {
  padding: 12px 16px;
}
.form-colorpicker .colorpicker-input-container .form-input {
  height: 24px;
  font-size: 11px;
  width: 235px;
}
.form-colorpicker .colorpicker-input-container .form-input::placeholder {
  font-size: 11px;
}
.form-colorpicker .colorpicker-footer {
  display: flex;
  justify-content: flex-end;
  padding: 0 16px;
  padding-bottom: 12px;
  width: 100%;
}
.form-colorpicker .colorpicker-btns .btn {
  margin-left: 8px;
}
@media (min-width: 50em) {
  .form-colorpicker .picker {
    width: 50%;
    float: left;
  }
}
